import { BsCaretDownFill, BsCaretUpFill } from "react-icons/bs";
import Select from "react-select";

export const EmployeesSalaryStracture = () => {
  return (
    <>
      <div className="profile_iner_cont">
        <div className="EmployeesDocument_top_title">
          <h3>Customize salary Stracture</h3>
        </div>
        <EmployeesSalaryStractureList />
      </div>
    </>
  );
};
const EmployeesSalaryStractureList = () => {
  const options = [
    { value: " precentage", label: " precentage" },
    { value: "Fixed", label: "Fixed" },
  ];
  const options2 = [
    { value: "Na", label: "NA" },
    { value: " precentage", label: " precentage" },
    { value: "Fixed", label: "Fixed" },
  ];
  const App = (props) => {
    return (
      <>
        <tr>
          <td>{props.Salary}</td>
          <td>
            <input
              type="number"
              class="form-control"
              placeholder={props.Amount}
            />
          </td>
          <td className="dep_all">
            <div className="dashboard_top_week_Select">
              <Select options={options} placeholder="precentage" />
            </div>
          </td>
          <td className="dep_all">
            <div className="dashboard_top_week_Select">
              <Select options={options2} placeholder="NA" />
            </div>
          </td>
        </tr>
      </>
    );
  };
  const Data = [
    {
      Salary: "Basic Salary",
      Amount: "112",
      Fixed: "Percentage",
      Taxable: "Yes",
    },
  ];

  return (
    <>
      <div>
        <div>
          <table className="table text-center IssueAssets_top_div">
            <thead>
              <tr>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    Salary Component
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    %age of CTC or Amount
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    Percentage or Fixed
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
                <th scope="col">
                  <span className="new_application_table_filter_div">
                    Taxable
                    <span className="new_application_table_filter">
                      <BsCaretUpFill />
                      <BsCaretDownFill />
                    </span>
                  </span>
                </th>
              </tr>
            </thead>
            <tbody>
              {Data.map((val, i) => {
                return (
                  <App
                    key={i}
                    Salary={val.Salary}
                    Amount={val.Amount}
                    Fixed={val.Fixed}
                    Taxable={val.Taxable}
                  />
                );
              })}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};
